import React, { useEffect } from "react";

const RealisticPizzaBurger = () => {
  useEffect(() => {
    // Draw Pizza - More toppings, visible slices
    const pizzaCanvas = document.getElementById("pizzaCanvas");
    const pizzaCtx = pizzaCanvas.getContext("2d");

    // Pizza Base (Dough)
    pizzaCtx.fillStyle = "#e2b97f"; // Realistic pizza dough
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 80, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Pizza Crust
    pizzaCtx.fillStyle = "#d68f3b"; // Crust color
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 85, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Tomato Sauce (Inner Circle)
    pizzaCtx.fillStyle = "#d93d3d"; // Tomato sauce
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 70, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Cheese Layer
    pizzaCtx.fillStyle = "#f9d75c"; // Cheese
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 65, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Visible Slices (Making slices appear)
    pizzaCtx.strokeStyle = "#d93d3d"; // Red slice boundary
    pizzaCtx.lineWidth = 5;
    pizzaCtx.beginPath();
    pizzaCtx.moveTo(100, 100);
    pizzaCtx.lineTo(100, 20); // Slice 1
    pizzaCtx.stroke();

    pizzaCtx.beginPath();
    pizzaCtx.moveTo(100, 100);
    pizzaCtx.lineTo(175, 100); // Slice 2
    pizzaCtx.stroke();

    pizzaCtx.beginPath();
    pizzaCtx.moveTo(100, 100);
    pizzaCtx.lineTo(100, 180); // Slice 3
    pizzaCtx.stroke();

    pizzaCtx.beginPath();
    pizzaCtx.moveTo(100, 100);
    pizzaCtx.lineTo(25, 100); // Slice 4
    pizzaCtx.stroke();

    // Toppings - Pepperoni
    pizzaCtx.fillStyle = "#d24949"; // Pepperoni red
    pizzaCtx.beginPath();
    pizzaCtx.arc(60, 70, 12, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(120, 70, 12, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(85, 130, 12, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(115, 140, 12, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(75, 160, 12, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 45, 12, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Additional Toppings - Mushrooms, Olives, Onions
    pizzaCtx.fillStyle = "#a68f62"; // Mushrooms
    pizzaCtx.beginPath();
    pizzaCtx.arc(130, 140, 7, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.fillStyle = "#4d4d4d"; // Black Olives
    pizzaCtx.beginPath();
    pizzaCtx.arc(75, 80, 7, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.fillStyle = "#f5b82d"; // Onions
    pizzaCtx.beginPath();
    pizzaCtx.arc(50, 130, 7, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Draw Burger - Adding More Layers (Realistic)
    const burgerCanvas = document.getElementById("burgerCanvas");
    const burgerCtx = burgerCanvas.getContext("2d");

    // Bottom Bun
    burgerCtx.fillStyle = "#f7c092"; // Bottom bun
    burgerCtx.beginPath();
    burgerCtx.arc(100, 160, 60, Math.PI, 0, true);
    burgerCtx.fill();

    // Patty (Burger)
    burgerCtx.fillStyle = "#4c3c3c"; // Beef patty
    burgerCtx.beginPath();
    burgerCtx.arc(100, 130, 50, 0, Math.PI * 2);
    burgerCtx.fill();

    // Lettuce (Realistic green)
    burgerCtx.fillStyle = "#73b87b"; // Lettuce color
    burgerCtx.beginPath();
    burgerCtx.arc(100, 110, 50, Math.PI, 0, true);
    burgerCtx.fill();

    // Tomato (Sliced)
    burgerCtx.fillStyle = "#e94e77"; // Tomato red
    burgerCtx.beginPath();
    burgerCtx.arc(100, 90, 40, Math.PI, 0, true);
    burgerCtx.fill();

    // Cheese Slice (More realistic yellow)
    burgerCtx.fillStyle = "#f9e16b"; // Cheese color
    burgerCtx.fillRect(50, 75, 100, 10); // A slice of cheese

    // Onions (Sliced)
    burgerCtx.fillStyle = "#f1c1a0"; // Onion slices
    burgerCtx.beginPath();
    burgerCtx.arc(70, 75, 5, 0, Math.PI * 2);
    burgerCtx.arc(130, 75, 5, 0, Math.PI * 2);
    burgerCtx.fill();

    // Top Bun
    burgerCtx.fillStyle = "#f7c092"; // Top bun (matching bottom bun)
    burgerCtx.beginPath();
    burgerCtx.arc(100, 60, 60, 0, Math.PI * 2);
    burgerCtx.fill();

    // Sesame Seeds (Realistic size and color)
    burgerCtx.fillStyle = "#e1b97a";
    burgerCtx.beginPath();
    burgerCtx.arc(70, 45, 4, 0, Math.PI * 2);
    burgerCtx.arc(100, 40, 4, 0, Math.PI * 2);
    burgerCtx.arc(130, 45, 4, 0, Math.PI * 2);
    burgerCtx.fill();
  }, []);

  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>Realistic Pizza & Burger</h2>
      <div style={styles.canvasContainer}>
        <canvas id="pizzaCanvas" width="200" height="200" style={styles.canvas}></canvas>
        <canvas id="burgerCanvas" width="200" height="200" style={styles.canvas}></canvas>
      </div>
    </div>
  );
};

const styles = {
  container: {
    textAlign: "center",
    padding: "20px",
    background: "linear-gradient(135deg, #ffe5d9, #fbd9e1)",
    borderRadius: "10px",
    boxShadow: "0px 4px 8px rgba(0, 0, 0, 0.2)",
    maxWidth: "500px",
    margin: "auto",
  },
  heading: {
    color: "#f04e8c",
    fontFamily: "'Poppins', sans-serif",
    marginBottom: "20px",
    fontSize: "24px",
  },
  canvasContainer: {
    display: "flex",
    justifyContent: "center",
    gap: "30px",
  },
  canvas: {
    border: "3px solid #f04e8c",
    borderRadius: "10px",
    backgroundColor: "#ffffff",
  },
};

export default RealisticPizzaBurger;
